import { about } from "../../Constants";

const Numbers = () => {
  return (
    <section className="bg-blue-100 padding">
      <div className="container grid grid-cols-4 md:gap-x-5 gap-3">
        {about.numbers.map((item, index) => {
          <div className="text-center" key={index}>
            <h6 className="text-blue-500 title">{item.number} +</h6>
            <h4 className="md:text-sm text-xs">{item.title}</h4>
          </div>;
        })}
      </div>
    </section>
  );
};

export default Numbers;
